import React from 'react'
import { TextField, List, ListItem } from '@material-ui/core'

class VinList extends React.Component {
    constructor(props) {
        super(props);
        this.state =  {
            vin: '',
            vin_list: ''
        }
      }
    handleVinChange(e) {
        console.log(e)

    }
    render() {
        return (
            <>
                <TextField 
                    id='vin'
                    label='vin'
                    value={this.state.vin}
                    onChange={this.handleVinChange}
                />
                
                <List label='vin list'>
                    <ListItem label='1'></ListItem>
                </List>
            </>
        )
    }
    

}

export default VinList
